import React from "react";

const Login = () => {
  return (
    <div className="login">
      <div className="login_wrapper">
        <div className="login_1">
          <img src="" alt="" srcset="" />
        </div>
        <div className="login_2"></div>
      </div>
      <div className="register"></div>
    </div>
  );
};

export default Login;
